import React from 'react'
import NavBtn from './navBtn/NavBtn'
import Styles from './NavBar.module.css'

const NavBar = (props) => {
    const buttons = ["main","shops","cart"]
    
    return (

        
            <ul className={Styles.navbar}>
                {buttons.map(button =>{
                    return(
                        <NavBtn
                         name={button}
                          key={button} 
                          cM={props.cM}
                          />
                    )
                })}    
            </ul>
        
    )
}
export default NavBar;
